import React, { Component } from "react";
import { MDBTable, MDBTableBody, MDBTableHead } from "mdbreact";

import antiStaticBags from "./product-data/bags/antiStaticBags";
console.log(antiStaticBags);

class App extends Component {
	state = {
		antiStaticBags: antiStaticBags
	};
	render() {
		return (
			<MDBTable striped>
				<MDBTableHead>
					<tr>
						<th>Product Number</th>
						<th>Durability</th>
						<th>Size</th>
						<th>Weight</th>
						<th>Bags Per Case</th>
					</tr>
				</MDBTableHead>
				<MDBTableBody>
					{/*<tr>*/}
					{/*	<td>{items.productNumber}</td>*/}
					{/*	<td>{items.durability}</td>*/}
					{/*	<td>{items.sizeWxL}</td>*/}
					{/*	<td>{items.weight}</td>*/}
					{/*	<td>{items.bagPerCase}</td>*/}
					{/*</tr>*/}
					{/*<tr>*/}
					{/*	{antiStaticBags.map(function(name, index) {*/}
					{/*		return (*/}
					{/*			<td>*/}
					{/*				{name.productNumber},{name.durability},{name.sizeWxL},*/}
					{/*				{name.weight},{name.bagPerCase}*/}
					{/*			</td>*/}
					{/*		);*/}
					{/*	})}*/}
					{/*</tr>*/}
					{
						antiStaticBags.map(bags => (
							<tr>
								<td>{bags.productNumber}</td>
								<td>{bags.durability}</td>
								<td>{bags.sizeWxL}</td>
								<td>{bags.weight}</td>
								<td>{bags.bagPerCase}</td>
							</tr>
						))
					}
				</MDBTableBody>
			</MDBTable>
		);
	}
}

export default App;
